        'chrome': ['style', 'script', 'class'],
        'firefox': ['style', 'script', 'class'],
        'ie8': ['style', 'script', 'class'],
        'ie9': ['style', 'script', 'class'],
        'ie10': ['style', 'script', 'class'],
        'ie10touch': ['style', 'script', 'class'],
        'ie11': ['style', 'script', 'class'],
